import './App.css';
import axios from 'axios';
import Boardgames from './components/boardgames';
import { useEffect, useState } from 'react';
import BoardgameSelector from './components/boardgameselector';

const API_BOARDGAMES_URL = "http://localhost:3000/api/v1/boardgames"
const API_TABLES_URL = "http://localhost:3000/api/v1/tables"
const API_BOOKINGS_URL = "http://localhost:3000/api/v1/bookings"

function getBoardgameData() {
  return axios.get(API_BOARDGAMES_URL).then((response) => response.data)
}

function getTableData() {
  return axios.get(API_TABLES_URL).then((response) => response.data)
}

function App() {
  const [boardgames, setBoardgames] = useState([]);
  const [tables, setTables] = useState([]);

  useEffect( () => {
    let mounted = true;
    getBoardgameData().then((items) => {
      if (mounted) {
        setBoardgames(items);
      }
    })
    return () => (mounted = false);
  }, []);

  return (
    <div className="App">

    </div>
  );
}

export default App;
